import React from 'react'
import './Home.css'

const Home = () => {
  return (
    <div className="Home">

        <div className="profileSide">Profile</div>
        <div className="postSide">Posts</div>
        <div className="RightSide">Rightside</div>

        // <PostSide/>
        // <RightSide/>
    </div>
  )
}
export default Home
